import React from 'react';
import WallpaperItem from './DDStuff';

const Wallpapers = ({files}) => {
    return (
        <div className="row">
            {files.map((file) => (
                    <WallpaperItem key={file.data.id} file={file} />  
            ))}
        </div>
    );
}

export default Wallpapers;
